import { Component } from '@angular/core';

@Component({
  selector: 'app-q8',
  templateUrl: './q8.component.html',
  styleUrls: ['./q8.component.css']
})
export class Q8Component {
  BestWinLosses: BestWinLoss[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getWinLoss()
      .subscribe(BestWinLosses => this.BestWinLosses = BestWinLosses);
  }
}
